import {
    Button,
    TouchableOpacity,
    Alert,
    Image,
    StyleSheet,
    Text,
    View,
} from "react-native";


export default function Component() {
    return (
        <View>
            <Image style={cstyle.img} source={require("../../assets/pic1.jpg")} />
            <Button
                title="CLICK ME"
                fontSize="20"
                fontWeight="bold"
                color="rgb(10,150,10)"
                onPress={() => {
                    Alert.alert("Hi there!!");
                }}
            />
            <TouchableOpacity
                onPress={() => {
                    Alert.alert("Good Evening Everyone !!");
                }}
            >
                <Text>Greeting Button</Text>
                <Image style={cstyle.img2} source={require("../../assets/pic3.jpg")} />
            </TouchableOpacity>
             <Text style={cstyle.text}> I'm Child component </Text>
        </View>
    );
}
const cstyle = StyleSheet.create({
    text: {
        marginBottom: 30,
        fontSize: 30,
        textAlign: "center",
        fontWeight: "bold",
    }, 
    img: {
        width: 400,
        height: 250,
    },
    img2: {
        width: 20,
        height: 20
    }
});
